  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'


const layoutProps = {

};
export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}><MDXTag name="p" components={components}><MDXTag name="a" components={components} parentName="p" props={{"href":"https://sprucelabsai.atlassian.net/browse/SK-"}}>{`SK-`}</MDXTag></MDXTag>
<MDXTag name="h2" components={components} props={{"id":"description"}}>{`Description`}</MDXTag>
<MDXTag name="p" components={components}>{`A simple description of the pull request.`}</MDXTag>
<MDXTag name="h2" components={components} props={{"id":"type"}}>{`Type`}</MDXTag>
<MDXTag name="ul" components={components}>
<MDXTag name="li" components={components} parentName="ul" props={{"className":"task-list-item"}}><MDXTag name="input" components={components} parentName="li" props={{"type":"checkbox","checked":false,"disabled":true}}></MDXTag>{` `}{`Feature`}</MDXTag>
<MDXTag name="li" components={components} parentName="ul" props={{"className":"task-list-item"}}><MDXTag name="input" components={components} parentName="li" props={{"type":"checkbox","checked":false,"disabled":true}}></MDXTag>{` `}{`Bug`}</MDXTag>
<MDXTag name="li" components={components} parentName="ul" props={{"className":"task-list-item"}}><MDXTag name="input" components={components} parentName="li" props={{"type":"checkbox","checked":false,"disabled":true}}></MDXTag>{` `}{`Tech debt`}</MDXTag>
</MDXTag>
           </MDXTag>
  }
}
MDXContent.isMDXComponent = true
